column8:
カラー：ブルー、オレンジ<br>
サイズ：幅200×奥行200×高さ135cm<br>
収納時（約）：Φ70cm<br>
重量（約）：1.8kg<br>
素材: 190Tポリエステル、B3メッシュ、オックスフォード生地、PMMA<br>
耐水圧：2000mm<br>
定員：3～4人<br>

付属品:テント本体 / 固定具（袋、ペグ、ロープ） / 収納バッグ<br><br>

※商品は、モニターによって色合いが異なって見える場合があります。<br>
※仕様・デザインは改良のため予告なく変更することがあります。<br>
※輸入品につき、多少の傷や汚れがある場合がございます。神経質な方は申し込みをお控え下さい。<br>
※本製品は撥水加工を施しておりますが、雨量によっては浸水することがあります。大雨、豪雨など、雨量が多い時のご使用はお控えください。<br><br>

ワンタッチシステム採用テント<br>
・放り投げるだけで女性でもラクラク展開！<br>
・使わない時は折りたたんでコンパクトに収納！キャリーバッグ付きなので、持ち運びもラクラク！<br>
・前後部にはメッシュ素材を使い、風通しバツグン！<br>
・遮熱性の高いシルバーコート生地採用。<br>
・突然の雨天でも安心！テントの生地には耐水圧2000mmの撥水加工素材を使用！縫い目にはシームテープ加工も施されているので、多少の雨でも安心してご使用いただけます。<br>
4本のロープ&8本のペグ付きなので風が強い日でも安心！<br>
